import React, { Component } from 'react';
import Portrait from '../Images/image.jpg';
import School from '../Images/ucsb.jpg';

export class Home extends Component {
  componentDidMount(){
    document.title = 'Rhianna So\'s Portfolio';
  }

  render() {
    return (
      <div>
        <div className='content'>
          <div className='section'>
            <div className='s1-image'>
              <img src={Portrait} alt='Me in San Francisco'/>
            </div>
            <div>
              <h2>About Me</h2>
              <hr/>
              <p>
                Hello I am Alex Funk.  A Fourth year Computer Science major, Philosophy minor and Technology Management Certificate pursuer.
                I love to paint, surf, spend time with my friends and play videogames.  I also have been building a company for the last ten months
                and am excited for what the future may hold.  I will be working at Apeel Sciences this summer and could not be more excited. 
                Feel free to take a look around this place.  You'll find my paintings and other goodies I find interesting and enjoy.
              </p>
            </div>
          </div>


        </div>
        <button className='scrollButton' style={{display: this.props.display}} onClick={this.props.scrollToTop}>Scroll to Top</button>
      </div>
    );
  }
}
export default Home;
